import logo from '../assets/logo.png'
import '../styles/Banner.css'

function Banner() {
    const title = 'Kasa'
    return (
        <div className='kasa-banner'>
            <img src={logo} alt='Kasa' className='kasa-logo' />
            <h1>{title}</h1>
        </div>
    )
}

export default Banner
